pragma solidity ^0.4.24;

contract test{
    
    struct details{
        string course;
        string matric_num;
        string dob;
        string graddate;
    }
    
    struct semester{
        int gpa;
        int courseWork;
    }
    
    mapping(uint => details) public Student;
    mapping (uint => bool) public exist;
    
    //create a array of user that can write 
    mapping(address => bool) public UniversityAdmin;

    //golbal ic number
    uint public ic;
    
    //counter for  number of student
    uint public studentsCount;
    
    //address of owner is only one.
    address owner = 0xa2e9947ede43Bf21dE7e55d982a6D172791AD912;

    
    
    constructor(address _owner) public{
        owner = _owner;
    }
    
    function addStudent(
        //list of variable in details
        string _course,
        string _matric_num,
        string _dob,
        int _gpa,
        string _graddate
        
    ) public {
        require(UniversityAdmin[msg.sender] || msg.sender == owner, "Invalid user");
        require(!exist[ic]);
        
        Student[ic] = details(_course,_matric_num, _dob,_graddate);
        studentsCount++;
        
    }
    
    function getDetails() view public returns (string, string){
        return (Student[ic].course, Student[ic].matric_num);
    }
    
    function addUniAddress(address _address) public{
    	require(msg.sender == owner);
        UniversityAdmin[_address] = true;
    }
    
    
}
